import org.apache.spark.sql.DataFrame

implicit class ZeppelinOutput(df:DataFrame) {
    def toZeppelin(limit:Int = -1)  = {
        println("%table")
        println(df.schema.map(_.name).mkString("\t"))
        val data = if (limit <= 0) df else df.limit(limit)
        data.collect.foreach(row => println(row.mkString("\t")))
    }
}

// Get position of 'index' in the schema schema for faster extraction
val idxIndex = indexedKeys.schema.fieldIndex("index")
// Get position of 'key' in the schema schema for faster extraction. Although we really do not need the key.
val keyIndex = indexedKeys.schema.fieldIndex("key")

// Create vertices from the indexedKeys. Map from every entry the 'index' to the vertex ID and the 'key' to be the vertex value. The result should be a RDD with entries (index, key)
val vertices = indexedKeys.map(x => ( x.getAs[Long](idxIndex), x.getAs[String](keyIndex)))

import org.apache.spark.graphx.Edge

// 1. Replace session keys by unique ID in indexed keys, keep CDK for next step
val resolvedSession = sessions.join(indexedKeys, indexedKeys("key") === sessions("session"))
    .select(
        indexedKeys("index") as "session_idx",
        sessions("cdk")
    )
// 2. Replace CDK by unique ID in indexed keys, keep ID from previous step
val resolvedAll = resolvedSession.join(indexedKeys, indexedKeys("key") === resolvedSession("cdk"))
    .select(
        indexedKeys("index") as "cdk_idx",
        resolvedSession("session_idx")
    )
// 3. Now you should have a DataFrame with columns for the ID of session and the ID for CDK
// 4. Map all entries to Edge(session_id, cdk_id)
val edges = resolvedAll.map(e => Edge[Long]( e.getAs[Long](0), e.getAs[Long](1), 0))

// 1. Convert Vertices back into a DataFrame
val resultSchema = StructType(
    StructField("original_idx", LongType)
    :: StructField("component_idx", LongType)
    :: Nil
)
val components = sqlContext.createDataFrame(connectedGraph.vertices.map(v => Row(v._1, v._2)), resultSchema)

// 2. Join indexedKeys to the DataFrame components on original_idx === index, look up session key
// 3. Keep only session keys (so we can put sessions together. Otherwise we could also put linking keys together)
// 4. Extract session key and component id, forget other columns
val sessionMapping = components.join(indexedKeys, components("original_idx") === indexedKeys("index"))
    .select(
        indexedKeys("key") as "original_key",
        indexedKeys("is_sessionkey"),
        components("component_idx")
    )
    .filter($"is_sessionkey")
    .select(
        $"original_key" as "session",
        $"component_idx" as "user_handle"
    )
